import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to get to a page with view toggle
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');

    // Wait for category page to load and take screenshot
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Switch to list view mode
    await page.waitForSelector('.view-toggle button[title="List View"]', { timeout: 5000 });
    await page.click('.view-toggle button[title="List View"]');

    // Wait for view change and verify
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Verify list view is active
    const listViewActive = await page.$eval('.view-toggle button[title="List View"]', 
      btn => btn.classList.contains('active'));

    return {
      success: true,
      action: "Successfully switched to list view mode",
      extractedData: {
        listViewActive: listViewActive,
        productCount: await page.$$eval('.product-card-list', items => items.length)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
